public Plugin:myinfo =
{
    name = "Rank Changer",
    author = "Your Name",
    description = "Allows users to change their displayed matchmaking rank",
    version = "1.0",
    url = "https://example.com"
};

public OnPluginStart()
{
    RegConsoleCmd("sm_rank", Command_Rank);
}

public Action:Command_Rank(client, args)
{
    if (args < 1)
    {
        PrintToChat(client, "Usage: sm_rank <rank>");
        return Plugin_Handled;
    }

    char rank[64];
    GetCmdArg(1, rank, sizeof(rank));

    int rankId = CSGORank_GetRankId(rank);
    if (rankId == -1)
    {
        PrintToChat(client, "Invalid rank");
        return Plugin_Handled;
    }

    CUserStats userStats = CUserStats(client);
    userStats.SetRank(rankId);

    PrintToChat(client, "Your rank has been changed to %s", rank);
    return Plugin_Handled;
}
